  return (
    <div>
      <Button variant="outlined" color="primary">

      </Button>
      <Dialog
        open={open}
        TransitionComponent={Transition}
        keepMounted
        onClose={handleClose}
        aria-labelledby="alert-dialog-slide-title"
        aria-describedby="alert-dialog-slide-description"
      >
        <DialogTitle className={classes.modelhead} id="alert-dialog-slide-title">{"How to add this link to your Instagram BIO"}</DialogTitle>
        <DialogContent>
          <DialogContentText id="alert-dialog-slide-description">
          <ul>
                   <li>Copy your link</li>
                   <li>Go on your profile in the app</li>
                   <li>Click on Edit Profile</li>
                   <li>Paste the link under Website section</li>
               </ul>
          </DialogContentText>
        </DialogContent>
        <DialogActions>
          <Button onClick={()=>{setOpen(false)}} className={classes.close}>
            Close
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
